import React from 'react'
import Card from './Card';
import data from './data'
const Service = () =>{
    return (<>
    <div className="text-center">
        <h1>Our Services</h1>
    </div>
    <div className=" mb-5">
        <div className="row">
            <div className="col-10 mx-auto">
                <div className="row gy-3">
                    
                        {data.map()}

                   
                </div>
            </div>
        </div>

    </div>
    </>);
}
export default Service;
